import React, { Component } from 'react';
import { Link } from "react-router-dom";

class Navegacion extends Component {
    render() {
        return (
            <div className="row justify-content-center d-flex ">
                    <nav className="col-12 nav d-flex mx-5">

                        <Link to={'/inicio'}> <a className="btn btn-link text-white menuBar btn-inline-block p-2"> Inicio </a> </Link>
                        <Link to={'/recetas'}> <a className="btn btn-link text-white menuBar btn-inline-block p-2"> Recetas </a></Link>
                        <Link to={'/social'}> <a className="btn btn-link text-white menuBar btn-inline-block p-2" > Social </a></Link>
                        <Link to={'/preguntas'}> <a className="btn btn-link text-white menuBar btn-inline-block p-2" >Preguntas</a> </Link>
                    </nav>
                </div>
        )
    }
}

export default Navegacion;
